import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import Parse from 'parse';

const Dashboard = () => {
  const navigate = useNavigate();
  const currentUser = Parse.User.current();

  // ·Äï·ÄØ·Ä∂·Äû·Ä±·Äõ·Äæ·Ä≠·Äõ·Äô·Äö·Ä∑·Ä∫ ·Ä°·Äê·Äî·Ä∫·Ä∏·ÄÖ·Ä¨·Äõ·ÄÑ·Ä∫·Ä∏ (Database ·Äô·Äæ·Ä¨ ·Äô·Äõ·Äæ·Ä≠·Äû·Ä±·Ä∏·Äõ·ÄÑ·Ä∫·Äê·Ä±·Ä¨·ÄÑ·Ä∫ Sidebar ·Äô·Äæ·Ä¨ ·Äï·Äº·Äñ·Ä≠·ÄØ·Ä∑)
  const defaultCourseList = [
    { id: "linux", title: "Linux Administration" },
    { id: "cyber", title: "Cyber Security" },
    { id: "net", title: "Networking" },
    { id: "py_basic", title: "Python (Basic)" },
    { id: "py_adv", title: "Python (Advanced)" },
    { id: "hacking", title: "Real World Hacking" }
  ];

  const [dbData, setDbData] = useState([]); // Database ·ÄÄ ·Äõ·Äú·Ä¨·Äê·Ä≤·Ä∑ data
  const [selectedId, setSelectedId] = useState("linux");
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchData = async () => {
      const Course = Parse.Object.extend("Classes");
      const query = new Parse.Query(Course);
      try {
        const results = await query.find();
        const data = results.map(o => ({
          courseId: o.get("courseId"),
          instructor: o.get("instructor"),
          zoom: o.get("zoomLink"),
          video: o.get("videoLink"),
          schedule: o.get("schedule")
        }));
        setDbData(data);
        setLoading(false);
      } catch (error) {
        console.error("Fetch Error:", error);
        setLoading(false);
      }
    };
    fetchData();
  }, []);

  // ·Äú·ÄÄ·Ä∫·Äõ·Äæ·Ä≠·Äõ·ÄΩ·Ä±·Ä∏·Äë·Ä¨·Ä∏·Äê·Ä≤·Ä∑ ·Ä°·Äê·Äî·Ä∫·Ä∏·Äõ·Ä≤·Ä∑ Database data ·ÄÄ·Ä≠·ÄØ ·Äõ·Äæ·Ä¨·ÄÅ·Äº·ÄÑ·Ä∫·Ä∏
  const currentDetails = dbData.find(item => item.courseId === selectedId) || {
    instructor: "Not Set",
    schedule: "TBA",
    zoom: "#",
    video: ""
  };

  const handleLogout = async () => {
    await Parse.User.logOut();
    navigate('/login');
  };

  if (!currentUser) return <div style={{textAlign: 'center', color: 'red', marginTop: '50px'}}>Access Denied!</div>;

  return (
    <div style={{ backgroundColor: '#0a192f', minHeight: '100vh', color: '#ccd6f6', display: 'flex', flexDirection: 'column' }}>

      {/* Navbar */}
      <nav style={styles.nav}>
        <h2 style={{ color: '#00ff41', margin: 0 }}>CS_SCHOOL TERMINAL</h2>
        <div style={{ display: 'flex', alignItems: 'center', gap: '20px' }}>
          <span>Agent: <span style={{color: '#00ff41'}}>{currentUser.get('username')}</span></span>
          <button onClick={handleLogout} style={styles.logoutBtn}>LOGOUT</button>
        </div>
      </nav>

      <div style={styles.contentLayout}>

        {/* Sidebar: ·Ä°·Äô·Äº·Ä≤·Äê·Äô·Ä∫·Ä∏ ·Ä°·Äê·Äî·Ä∫·Ä∏ ·ÅÜ ·ÄÅ·ÄØ ·Äï·Ä±·Ä´·Ä∫·Äî·Ä±·Äô·Äö·Ä∫ */}
        <div style={styles.sidebar}>
          <h3 style={{color: '#8892b0', fontSize: '12px', padding: '0 10px'}}>MY MISSIONS</h3>
          {defaultCourseList.map(course => (
            <div 
              key={course.id} 
              onClick={() => setSelectedId(course.id)}
              style={{
                ...styles.courseTab,
                backgroundColor: selectedId === course.id ? '#112240' : 'transparent',
                borderLeft: selectedId === course.id ? '4px solid #00ff41' : '4px solid transparent',
                color: selectedId === course.id ? '#00ff41' : '#8892b0'
              }}
            >
              {course.title}
            </div>
          ))}
        </div>

        {/* Main Area: Admin ·ÄÄ ·Äê·ÄÑ·Ä∫·Äê·Ä≤·Ä∑ Data ·Äï·Ä±·Ä´·Ä∫·Äô·Äö·Ä∑·Ä∫·Äî·Ä±·Äõ·Ä¨ */}
        <div style={styles.mainArea}>
          <div style={styles.headerBox}>
            <h1 style={{margin: 0, color: '#00ff41'}}>
              {defaultCourseList.find(c => c.id === selectedId)?.title}
            </h1>
            <p style={{color: '#8892b0'}}>Instructor: <span style={{color: '#fff'}}>{currentDetails.instructor}</span></p>
            <p style={{color: '#8892b0'}}>üïí Schedule: {currentDetails.schedule}</p>
          </div>

          <div style={styles.actionGrid}>
            <div style={styles.card}>
              <h3 style={{color: '#00ff41'}}>üî¥ Live Access</h3>
              <p>Zoom Meeting ·Äú·ÄÑ·Ä∑·Ä∫·ÄÅ·Ä∫</p>
              <a href={currentDetails.zoom} target="_blank" rel="noreferrer" style={currentDetails.zoom === "#" ? styles.disabledBtn : styles.zoomBtn}>
                {currentDetails.zoom === "#" ? "NO LINK YET" : "JOIN ZOOM CLASS"}
              </a>
            </div>

            <div style={styles.card}>
              <h3 style={{color: '#00ff41'}}>üì∫ Recorded Lesson</h3>
              <div style={styles.videoWrapper}>
                {currentDetails.video ? (
                  <iframe 
                    src={`https://www.youtube.com/embed/${currentDetails.video}`}
                    title="Lesson" frameBorder="0" allowFullScreen
                    style={{width: '100%', height: '200px', borderRadius: '8px', border: '1px solid #233554'}}
                  ></iframe>
                ) : (
                  <div style={{textAlign: 'center', padding: '50px 0', color: '#444', border: '1px dashed #233554'}}>No Video ID Found</div>
                )}
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

const styles = {
  nav: { display: 'flex', justifyContent: 'space-between', padding: '15px 5%', background: '#112240', borderBottom: '2px solid #00ff41', alignItems: 'center' },
  logoutBtn: { background: 'transparent', color: '#ff4b2b', border: '1px solid #ff4b2b', padding: '5px 15px', borderRadius: '5px', cursor: 'pointer' },
  contentLayout: { display: 'flex', flex: 1 },
  sidebar: { width: '280px', background: '#0a192f', borderRight: '1px solid #233554', padding: '20px 10px' },
  courseTab: { padding: '15px', cursor: 'pointer', borderRadius: '4px', marginBottom: '5px', fontWeight: 'bold', fontSize: '14px' },
  mainArea: { flex: 1, padding: '40px' },
  headerBox: { marginBottom: '30px' },
  actionGrid: { display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(350px, 1fr))', gap: '20px' },
  card: { background: '#112240', padding: '25px', borderRadius: '12px', border: '1px solid #233554' },
  zoomBtn: { display: 'block', textAlign: 'center', background: '#00ff41', color: '#0a192f', textDecoration: 'none', padding: '12px', borderRadius: '5px', fontWeight: 'bold' },
  disabledBtn: { display: 'block', textAlign: 'center', background: '#233554', color: '#8892b0', textDecoration: 'none', padding: '12px', borderRadius: '5px', cursor: 'not-allowed' },
  videoWrapper: { marginTop: '15px' }
};

export default Dashboard;
